package main

import (
	"fmt"
)

func main() {
	fmt.Println("Start:")
	out(data)

	final := extract(data)
	fmt.Println("Final:")
	out(final)
}

func extract(data string) string {
	s := stack{}

	for i := len(data) - 1; i >= 0; i-- {
		s = s.Push(int(data[i]))
	}

	final := stack{}
	a := 0
	var b *int

	for s.Peek() != nil {
		s, a = s.Pop()
		b = s.Peek()
		if b == nil {
			final = final.Push(a)
			return final.Reverse().Print()
		}

		if compare(a, *b) {
			// throw the next one away
			s, _ = s.Pop()
			if final.Peek() != nil {
				var x int
				final, x = final.Pop()
				s = s.Push(x)
			}
		} else {
			final = final.Push(a)
		}

	}

	return final.Reverse().Print()
}

func compare(a, b int) bool {
	x := a - b
	if x < 0 {
		x = -1 * x
	}
	return x == 32
}

func out(s string) {
	if len(s) > 100 {
		fmt.Printf("Units (%v): %v\n", len(s), s[:99])
	} else {
		fmt.Println(s)
	}
}

